window.bookSummaryJSON = "<p><b>The one man she can't have.</b></p> <p>Matt Dean was born to fight...and kill. A member of a secret black-ops military unit, he and his brothers were genetically engineered by the government to be the perfect soldiers with an expiration date. Now, with time running out, he's gone rogue in a relentless quest for the one person who can save them.</p> <p>His mission leads him to Charmed, Idaho...and to a beautiful woman with eyes like emeralds and a body made for pleasure.</p> <p><b>The one woman he can't resist.</b></p> <p>Laney Jacobs knows the mysterious, handsome stranger is trouble from the moment he walks into her bar, looking for a job. She's spent years running from her own past-the last thing she needs is a romantic entanglement. But Matt's strong arms offer her protection and his gentle touch promises passion unlike anything she's ever known.</p> <p>As lethal forces surround them, revealing explosive secrets about Matt's past and putting everything-and everyone-he holds dear in danger, can he save them all before time runs out?</p>"; 
